import React from "react";
import "./style.css"

function SearchForm(props) {
    return(
        <div id="searchContainer" className="justify-content-md-center">

            <form id="bookSearch" >

            value={props.search}
          onChange={props.handleInputChange}
          list="breeds"
          className="form-control"
          placeholder="Type in a dog breed to begin"
          id="breed"


                <input type="text" name="bookSearch" id="searchTerm" form="bookSearch" placeholder="Book Title" required/>
                <button id="submitButton" type="submit" onClick={props.handleFormSubmit}>Search</button>
            </form>
        </div>
    );
}

export default SearchForm;
